import './App.css';
import DashBoard from './Component/DashBoard';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import SearchBar from './Component/SearchBar';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path="/" element={<DashBoard/>}></Route>
        <Route path='searchbar' element={<SearchBar/>}></Route>
      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
